    // xhr.setRequestHeader("Content-Type", "application/json");
    // xhr.send(
    //   JSON.stringify({
    //     value: value,
    //   })
    // );
  }

  return (
    <View>
      <Text>Press button for test</Text>
      <Button onPress={() => submitForm()} title="Click me"></Button>
    </View>
  );
}
